// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.8.1;

import "./ClockAuction.sol";
import "./ICellClockAuction.sol";
import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";
import "@openzeppelin/contracts/utils/introspection/ERC165.sol";

/// @title Clock auction modified for sale of Cell tokens
contract CellClockAuction is ClockAuction, ERC165, AccessControlEnumerable {
    bytes32 public constant ROLE_OWNER = keccak256("ROLE_OWNER");
    bytes32 public constant ROLE_OPERATOR = keccak256("ROLE_OPERATOR");
    bytes32 public constant ROLE_CORE_CONTRACT = keccak256("ROLE_CORE_CONTRACT");

    address payable public financeAccount;

    // Tracks last 5 sale prices of newly discovered Cells
    uint256 public discoveredCellSaleCount;
    uint256[5] public lastDiscoveredCellSalePrices;

    constructor(address _cellContractAddress, uint256 _ownerCut) ClockAuction(_cellContractAddress, _ownerCut) {
        _setupRole(ROLE_OWNER, msg.sender);
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);

        financeAccount = payable(msg.sender);
    }

    /// @param _address - Address to receive proceeds of auctions created by core contract
    function setFinanceAccount(address payable _address) external onlyRole(ROLE_OWNER) {
        financeAccount = _address;
    }

    /// @dev Allows an operator to retrieve funds from the contract into the finance account
    function retrieveFunds() external onlyRole(ROLE_OPERATOR) {
        uint256 balance = address(this).balance;
        financeAccount.transfer(balance);
    }

    //introspect yourself, fool
    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC165, IERC165, AccessControlEnumerable) returns (bool) {
        return interfaceId == type(ICellClockAuction).interfaceId || super.supportsInterface(interfaceId);
    }

    /// @dev Updates lastDiscoveredCellSalePrices if seller is the Cell contract
    /// Otherwise, works the same as default bid method.
    function bid(uint256 _tokenId) public payable override {
        //store the address of the seller before the auction is removed
        address seller = tokenIdToAuction[_tokenId].seller;

        // _bid will 'throw' if the bid or funds transfer fails
        uint256 price = _bid(_tokenId, msg.value);
        _transfer(msg.sender, _tokenId);

        // If this is a 'discovered Cell' auction (and the bid is successful), 
        // track the winning price
        if (hasRole(ROLE_OPERATOR, seller) || hasRole(ROLE_CORE_CONTRACT, seller)) {
            lastDiscoveredCellSalePrices[discoveredCellSaleCount % 5] = price;
            discoveredCellSaleCount++;
        }
    }

    function averageDiscoveredCellSalePrice() public view returns (uint256) {
        uint256 sum = 0;
        for (uint256 i = 0; i < 5; i++) {
            sum += lastDiscoveredCellSalePrices[i];
        }

        return sum / 5;
    }
}
